         QScriptValue REcmaView::toString
    (QScriptContext *context, QScriptEngine *engine)
    
    {

    RView* self = getSelf("toString", context);
    
    QString result;
    
            QDebug d(&result);
            if (self!=NULL) {
                d << *self;
            }
            else {
                d << "NULL";
            }
        
    return QScriptValue(result);
    }
     QScriptValue REcmaView::destroy(QScriptContext *context, QScriptEngine *engine)
    
    {

        RView* self = getSelf("RView", context);
        //Q_ASSERT(self!=NULL);
        if (self==NULL) {
            return REcmaHelper::throwError("self is NULL", context);
        }
        
    
        delete self;
        context->thisObject().setData(engine->nullValue());
        context->thisObject().prototype().setData(engine->nullValue());
        context->thisObject().setPrototype(engine->nullValue());
        context->thisObject().setScriptClass(NULL);
        return engine->undefinedValue();
    }
    RView* REcmaView::getSelf(const QString& fName, QScriptContext* context)
    
        {
            RView* self = NULL;

            
                // self could be a normal object (e.g. from an UI file) or
                // an ECMA shell object (made from an ECMA script):
                //self = getSelfShell(fName, context);
                

            //if (self==NULL) {
                self = REcmaHelper::scriptValueTo<RView >(context->thisObject())
                
                ;
            //}

            if (self == NULL){
                // avoid recursion (toString is used by the backtrace):
                if (fName!="toString") {
                    REcmaHelper::throwError(QString("RView.%1(): "
                        "This object is not a RView").arg(fName),
                        context);
                }
                return NULL;
            }

            return self;
        }
        RView* REcmaView::getSelfShell(const QString& fName, QScriptContext* context)
    
        {
          RView* selfBase = getSelf(fName, context);
                RView* self = dynamic_cast<RView*>(selfBase);
                //return REcmaHelper::scriptValueTo<RView >(context->thisObject());
            if(self == NULL){
                REcmaHelper::throwError(QString("RView.%1(): "
                    "This object is not a RView").arg(fName),
                    context);
            }

            return self;
            


        }
        